const imageLink = () => {
    return (
        <div>
            <p style={{ fontFamily: 'georgia' }} className='f3'>
                {'This Will Detect Faves In your Pictures'}
            </p>
            <div>
                <input className='f4 pa2 w-70 center' type='tex' />
                <button className='w-30 grow f4 link ph3 pv2 dib white bg-lightgreen'>Dectect</button>
            </div>
        </div>
    );
}


export default imageLink;
